import React from "react";
import { useEffect, useState } from "react";

import Col from "react-bootstrap/Col";

import "../CSS/home.css";

const Home = () => {
  const [cases, setCases] = useState(0);

  useEffect(() => {
    fetch("/global-data")
      .then((res) => res.json())
      .then((data) => {
        setCases(data[0].confirmed);
      });
  }, []);

  return (
    <div className="HomePage">
      <Col>
        <h1>image</h1>
      </Col>
      <Col>
        <h1>{cases}</h1>
      </Col>
      <Col>
        <h1>country</h1>
      </Col>
    </div>
  );
};

export default Home;
